import React from "react";
import '../styles/about.css';
import anchorIcon from "../resource/anchor.png"
const About =()=>{
    return(
        <div className="aboutContent">
            <img src={anchorIcon} alt="Anchor"/>
            <h1>
                We are Oshine, a beautiful responsive multi-purpose wordpress theme that comes with 15 unique and stunning demos. We have crafted each and every demo with extensive care and precision and the theme is power packed yet easy to use.
            </h1>
        </div>
    )
}
export default About
